import {configureStore} from '@reduxjs/toolkit'
import listReducer from '../slices/listsSlice'
import todosReducer from '../slices/todosSlice'

export const store = configureStore({
    reducer:{
        lists:listsReducer,
        todos:todosReducer,
    }
})
